import specialsCss from "../specials.module.css";
import Content from './content';


export default function Articles(props) {
  console.log(props);
  
  return (
    <div className={specialsCss.passages}>
      <div className={specialsCss.passagesTitle}>{props.data.articleTitle}</div>
      <div className={specialsCss.passagesContent}>
        <Content data={props.data.conent} />
      </div>
    </div>
  )
}
